import React from 'react';
import { Home } from './pages/home/Home';
import { BrowserRouter, Switch, Route } from 'react-router-dom'

const Routes = () => {
  return (
		<BrowserRouter>
			<Switch>
				<Route path="/" exact={true} component={Home} />
			</Switch>
		</ BrowserRouter>
	)
};

export {Routes};
